  \"2013-03-15T09:18:37.319835\",\n\t\"name\": \"field-plot-points-for-new-river-gorge-national-river-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains point features which
  represent locations of vegetation sampling plots in the New River Gorge National
  River. Location coordinates for most plots were collected using a global positioning
  system and details on these data are included in the attribute table. Attributes
  for GPS data follow the field naming conventions of Trimble Pathfinder Office software.
  The attribute table also includes information on date of plot sampling, surveyors
  names, and community classification. Complete data from plots is archived in the
  Plots2-WV database maintained by the West Virginia Natural Heritage Program. In
  this data set, the X, Y coordinates for 15 plots have been altered to protect a
  rare species that could be vulnerable to collection.\",\n\t\"license_title\": null,\n\t\"extras\":
